import React, { useState, useEffect} from "react";
import WeatherForecastService from '../service/WeatherForecastService';

function WeatherForecastComponent(props){

    console.log("som vo forecast component")
    console.log("props: " + JSON.stringify(props.history.location.state))

    const [dailyWeatherForecast, setDailyWeatherForecast] = useState({})

    useEffect(() =>{
        console.log("som v useEffect forecast component")
        console.log("func: " )
        (getDailyWeatherForecast(props.history.location.state.lat, props.history.location.state.lon).then(
            response => {
                // console.log("response.data: " + JSON.stringify(response.data))
                setDailyWeatherForecast(response.data)
            }
        ));
    }, [null === dailyWeatherForecast])

    console.log("dailyWeatherForecast: " + JSON.stringify(dailyWeatherForecast))
    if (dailyWeatherForecast)
        return (<tbody>{
            dailyWeatherForecast.data.daily?.map( 
                weatherForecast =>{
                    return (<tr key ={WeatherForecastComponent.id}>
                        <td>{weatherForecast.id}</td>
                        </tr>
                    )}
            )
        }</tbody>)
        else return ;
}

const getDailyWeatherForecast = async (lat, lon) => {
    console.log("som v metode getDailyWeatherForecast")
    const dailyWeatherForecastFunc = await WeatherForecastService.getDailyForecastByCityName(lat, lon, "Current,Hourly,Minutely")
    console.log("dailyWeatherForecastFunc: " + JSON.stringify(dailyWeatherForecastFunc))
    return dailyWeatherForecastFunc
}
export default WeatherForecastComponent
